// frontend/src/components/CartPage.js
import React from 'react';

const CartPage = () => {
  return (
    <div className="container mt-5">
      <h1>Your Cart</h1>
      <p>Items you have added to your cart.</p>
    </div>
  );
};

export default CartPage;
